component input_neuron is
    Port ( time_period : in STD_LOGIC_VECTOR (8 downto 0);
           time_step : in STD_LOGIC;
           rst : in STD_LOGIC;
           spike : out STD_LOGIC);
end component input_neuron;
    
 signal time_period : STD_LOGIC_VECTOR (8 downto 0);
 signal spikes: std_logic_vector(0 to 783) :=(others=>'0');
 signal time_step: std_logic := '0';
 signal counter: integer :=0;

 
begin

NEURON_GEN :
    for n in 0 to NEURONS-1 generate
-- Neuron instantiation
    Neuron_Input_Instance : input_neuron
        port map (
            time_step   => time_step,
            rst  => rst,
            spike => spikes(n),
            time_period => periods(n)
        );
        end generate;     

