advance_time_step: process(clk,rst,start)

begin
    if(rst='1') then
        spike<='0';
    elsif (rising_edge(clk)  and start='1') then
        if(counter=NEURONS-1) then
            clr<='1';
            time_step<='1';
            spike<='0';
            counter<=0;   
        else
            clr<='0';
            time_step<='0';
            spike<=spikes(counter);
            counter<=counter+1;
        end if;
        
    end if;
end process;



